export default function Resume() {
  return (
    <div id="resume">
      <div className="center center-text">
        <i className="fa fa-file-text fa-2x"></i>
        <h1>Resume</h1>

        <p style={{ paddingTop: "25px" }}>This is the most up to date version of my resume. I am continuing to update & improve this with the goal of becoming a software engineer & web developer.</p>

        <div style={{ paddingTop: "15px" }}>
          <a className="link" href="/Resume.html" target="_blank" rel="noopener noreferrer">View Resume &rarr;</a>
        </div>
      </div>
    </div>
  );
}
